The function of the Gene Technology Ethics and Community Consultative Committee is to provide advice, on the request of the Regulator or the Ministerial Council, on the following:
(a) ethical issues relating to gene technology;
(b) the need for, and content of, codes of practice in relation to
ethics in respect of conducting dealings with GMOs;
(c) the need for, and content of, policy principles in relation to
dealings with GMOs that should not be conducted for ethical
reasons;
(d) the need for policy principles, policy guidelines, codes of
practice and technical and procedural guidelines in relation to
GMOs and GM products and the content of such principles,
guidelines and codes;
(e) community consultation in respect of the process for
applications for licences covering dealings that involve the
intentional release of a GMO into the environment;
(f) risk communication matters in relation to dealings that
involve the intentional release of a GMO into the
environment;
(g) matters of general concern identified by the Regulator in
relation to applications made under this Act;
(h) matters of general concern in relation to GMOs.

The Gene Technology Technical Advisory Committee provides scientific and technical advice, on at the request of the Gene Technology Regulator or the Gene Technology Ministerial Council, on:
a) gene technology, genetically modified organisms (GMOs) and genetically modified (GM) products;
b) applications made under the Gene Technology Act 200;
c) the biosafety aspects of gene technology;
d) the need for policy principles, policy guidelines, codes of practice and technical and procedural guidelines in relation to GMOs and GM products, and the content of such principles, guidelines and codes.

MPRCs are independent statutory committees established on a case by case basis to make independent determinations of whether a practitioner, or where relevant a person, should maintain the right to participate in Medicare, in the following circumstances:
where a practitioner has been convicted of relevant criminal offences;
where a practitioner has been found to have engaged in inappropriate practice on two separate occasions under the Professional Services Review (PSR) Scheme;
where a practitioner or pathology company is reasonably believed to have breached a pathology undertaking; or
where a practitioner or person is reasonably believed to have engaged in prohibited diagnostic imaging practices.

The SIGB is a Board of Secretaries and Chief Executives representing central bodies, portfolio departments and delivery agencies.

This Board will:

Oversee and monitor the implementation of the ICT Strategy;
Develop and set whole-of-government strategic ICT policy;
Agree opportunities and priority areas for standardisation, consolidation and common approaches based on demonstrated business value to Government;
Assess agency requests for opt-outs from agreed common ICT approaches that are set by either the SIGB or by Government;
Be responsible for the strategic management of ICT investments across non-corporate Commonwealth Entity (NCCE) agencies and review, on an annual basis, key trends in the Government’s ICT expenditure;
Be responsible for determining the Government’s response to emerging ICT trends and issues;
Build a coordinated view of ICT capabilities and facilities across Australian Government agencies;
Oversee the activities of lead agencies who are progressing whole-of-government ICT initiatives; and
Consider and review the annual work plan of the Chief Information Officer Committee (CIOC) and the Authentication Governance Committee (AGC).

The CRC for Spatial Information aims to spatially enable Australian and New Zealand industries and communities by:
Supporting the creation of a coordinated national network of satellite system reference stations to permit real-time precise positioning of people, vehicles, built infrastructure and natural assets;
Providing underpinning research for the establishment of an Australia and New Zealand spatial information marketplace that will enable all users to access the substantial data stores in government and other sectors;
Automating the production of essential spatial information products and combining existing data stores in smarter ways with the rapidly increasing stream of data from earth observation satellites, airborne imaging platforms, and ground-based sensor systems.
